(296, '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2016/01/wordpress-4-4-1-security-and-maintenance-release/''>WordPress 4.4.1 Security and Maintenance Release</a> <span class="rss-date">January 6, 2016</span><div class="rssSummary">WordPress 4.4.1 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. WordPress versions 4.4 and earlier are affected by a cross-site scripting vulnerability that could allow a site to be compromised. This was reported by Crtc4L. There were also several non-security bug fixes: Emoji [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://ma.tt/2016/01/testimonials-for-wordpress/''>Matt: Testimonials for WordPress</a></li><li><a class=''rsswidget'' href=''http://wptavern.com/early-bird-tickets-for-wooconf-2016-now-on-sale''>WPTavern: Early Bird Tickets for WooConf 2016 Now on Sale</a></li><li><a class=''rsswidget'' href=''http://wptavern.com/wpweekly-episode-222-ithemes-enters-the-real-time-backup-space''>WPTavern: WPWeekly Episode 222 – iThemes Enters The Real Time Backup Space</a></li></ul></div><div class="rss-widget"><ul><li class=''dashboard-news-plugin''><span>Popular Plugin:</span> <a href=''https://wordpress.org/plugins/siteorigin-panels/'' class=''dashboard-news-plugin-link''>Page Builder by SiteOrigin</a>&nbsp;<span>(<a href=''plugin-install.php?tab=plugin-information&amp;plugin=siteorigin-panels&amp;_wpnonce=2210eec583&amp;TB_iframe=true&amp;width=600&amp;height=800'' class=''thickbox'' title=''Page Builder by SiteOrigin''>Install</a>)</span></li></ul></div>', 'no'),
